INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAG', 'STOCK', 'Conagra Brands, Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'A ConAgra Brands, Inc. É uma empresa de alimentos para bens de consumo. Os segmentos da Companhia incluem mercearia e lanches que incluem produtos alimentícios de marca, estáveis em prateleiras, vendidos em vários canais de varejo nos Estados Unidos; o segmento refrigerado e congelado inclui produtos alimentícios de marca e temperatura controlada vendidos em vários canais de varejo nos Estados Unidos; o segmento internacional inclui principalmente produtos alimentícios de marca em vários estados de temperatura, vendidos em vários canais de varejo e serviços alimentícios fora dos Estados Unidos, e o segmento Foodservice inclui produtos alimentícios de marca e personalizados, incluindo refeições, entradas, molhos e uma variedade de produtos culinários personalizados embalados para venda a restaurantes e outros estabelecimentos de serviços alimentícios principalmente nos Estados Unidos. Suas marcas incluem Birds Eye, Duncan Hines, Healthy Choice, Marie Callender''s, Reddi-wip, e BOOMCHICK', 'Chicago, IL, United States', 18300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOC', 'STOCK', 'Healthpeak Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'Healthpeak Properties, Inc. É uma confiança de investimento imobiliário totalmente integrada (REIT). A empresa adquire, desenvolve, possui, aluga e gerencia imóveis de saúde em todos os Estados Unidos. Sua estratégia é investir e gerenciar imóveis focados na descoberta e entrega de cuidados de saúde. Possui um portfólio diversificado de propriedades de saúde de alta qualidade em três classes de ativos principais de imóveis de laboratório, médicos ambulatoriais e comunidade de aposentadoria de cuidados contínuos (CCRC). Os segmentos da empresa incluem Lab, Ambulatório médico e CCRC. As propriedades do segmento de laboratório contêm espaço de laboratório e escritório, são alugadas principalmente a empresas de biotecnologia, dispositivos médicos e farmacêuticos, instituições de pesquisa científica, agências governamentais e outras organizações envolvidas na indústria de ciências da vida. O segmento Médico ambulatorial inclui edifícios médicos e hospitais. Os edifícios médicos ambulatoriai', 'Denver, CO, United States', 387);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASTS', 'STOCK', 'AST SpaceMobile, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'AST SpaceMobile, Inc. is engaged in building a global cellular broadband network in space to operate directly with standard, unmodified mobile devices based on its intellectual property (IP) and patent portfolio and designed for both commercial and government applications. The Company is engaged in designing and developing the constellation of BlueBird (BB) satellites and has planned space-based Cellular Broadband network distributed through a constellation of low Earth orbit (LEO) satellites. Its SpaceMobile Service is being designed to provide high-speed cellular broadband services to end-users who are out of terrestrial cellular coverage using existing mobile devices. The Company intends to continue testing capabilities of the BW3 test satellite, including further testing with cellular service providers and the government. The Company has operations in India, Scotland, Spain, Israel and Lithuania.', 'Midland, TX, United States', 578);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVS', 'STOCK', 'CVS Health Corporation', 'NYQ', 'Healthcare', 'Healthcare Plans', 'CVS Health Corporation é uma empresa de soluções de saúde. Os segmentos da empresa incluem benefícios de cuidados de saúde, serviços de saúde, farmácia e bem-estar do consumidor e corporativo/outro. O segmento de benefícios de cuidados de saúde oferece uma gama de produtos de seguros de saúde tradicionais, voluntários e direcionados ao consumidor e serviços relacionados, incluindo planos de saúde médicos, farmácia, odontológicos e comportamentais, capacidades de gestão médica, PDP e serviços de gestão de cuidados de saúde da Medicaid. O segmento de Serviços de Saúde oferece uma gama completa de soluções PBM, oferece serviços de saúde em suas clínicas médicas, virtualmente e em casa, e oferece soluções de capacitação de provedores. O segmento de Farmácia & Bem-Estar do Consumidor dispensa prescrições nas suas farmácias de retalho e através das suas operações de infusão, presta serviços de farmácia auxiliares, incluindo programas de cuidados de farmácia, testes de diagnóstico e administr', 'Woonsocket, RI, United States', 219000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDE', 'STOCK', 'Coeur Mining, Inc.', 'NYQ', 'Basic Materials', 'Gold', 'Coeur Mining, Inc. is a diversified precious metals producer. The Company has five wholly owned operations: the Las Chispas silver-gold mine in Sonora, Mexico, the Palmarejo gold-silver complex in Chihuahua, Mexico, the Rochester silver-gold mine in Nevada, the Kensington gold mine in Alaska and the Wharf gold mine in South Dakota. In addition, the Company wholly owns the Silvertip polymetallic critical minerals exploration project in British Columbia. The Las Chispas Operation is located approximately 180 kilometers (km) northeast of Hermosillo, Sonora, Mexico. The Palmarejo complex consists of the Palmarejo processing facility, three underground mines, exploration targets and a campsite. The Rochester mine is an open pit, heap leach silver-gold operation, located in Pershing County, Nevada. The Kensington mine is an underground gold operation located in southeast Alaska. Wharf is an open pit, heap leach gold operation located in the northern Black Hills of western South Dakota.', 'Chicago, IL, United States', 2116);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BB', 'STOCK', 'BlackBerry Limited', 'NYQ', 'Technology', 'Software - Infrastructure', 'BlackBerry Limited is a Canada-based company, which provides enterprises and governments the intelligent software and services. The Company delivers operational resiliency with the certified platform for mobile fortification, mission-critical communications, and critical events management. It operates in three segments: Secure Communications, QNX, and Licensing. The Secure Communications segment consists of BlackBerry UEM, BlackBerry AtHoc, and BlackBerry SecuSUITE. Its endpoint management platform includes BlackBerry UEM, BlackBerry Dynamics, and BlackBerry Workspaces solutions. The QNX segment consists of BlackBerry QNX, BlackBerry Certicom, BlackBerry Radar, and other QNX applications. The Licensing segment consists of the Companys intellectual property arrangements and settlement awards. Its BlackBerry Radar is a family of asset monitoring and telematics solutions for the transportation and logistics industry.', 'Waterloo, ON, Canada', 1820);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMKR', 'STOCK', 'Amkor Technology, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'Amkor Technology, Inc. is a provider of outsourced semiconductor packaging and test services. The Company is engaged in the outsourcing of semiconductor packaging and test services. It designs and develops packaging and tests technologies focused on advanced packaging solutions, including artificial intelligence. Its packaging and test services are designed to meet application and chip-specific requirements, including: the required type of interconnect technology; size; thickness; electrical, mechanical, and thermal performance. It provides turnkey packaging and test services including semiconductor wafer bump, wafer probe, wafer back-grind, package design, packaging, system-level and final test and drop shipment services. The Company offers services to integrated device manufacturers (IDMs), fabless semiconductor companies, original equipment manufacturers (OEMs) and contract foundries. It allows IDMs to outsource packaging and test services and focus their investments.', 'Tempe, AZ, United States', 28300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ERIC', 'STOCK', 'Telefonaktiebolaget LM Ericsson (publ)', 'NMS', 'Technology', 'Communication Equipment', 'A Telefonaktiebolaget LM Ericsson (LM Ericsson) oferece um portfólio de sistemas e serviços de telecomunicações e comunicação de dados cobrindo uma variedade de tecnologias. Oferece soluções ponta a ponta para todos os principais padrões de comunicação móvel. A LM Ericsson possui três segmentos de negócios: Sistemas, Telefones e Outras Operações. O segmento de Sistemas dirige-se a operadoras de redes telefônicas públicas móveis e fixas. O segmento de telefones dirige-se aos distribuidores de aparelhos móveis aos usuários finais. O segmento Outras Operações consiste em várias operações diferentes com diferentes tipos de clientes.As operações incluídas são sistemas de micro-ondas (defesa), sistemas empresariais, tecnologias de rede (cabos), plataformas móveis e módulos de energia. Durante o ano findo em 31 de dezembro de 2005, a Companhia adquiriu a NetSpira Networks, S.L. e Axxessit AsA. A NetSpira Networks, S.L. é uma empresa espanhola de software. A Axxessit AsA é uma empresa noruegue', 'Stockholm, , Sweden', 91937);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('C', 'STOCK', 'Citigroup Inc.', 'NYQ', 'Financial Services', 'Banks - Diversified', 'A Citigroup Inc. É uma holding global de serviços financeiros diversificados. Os segmentos da Companhia incluem Serviços, Mercados, Banca, Riqueza e U.S. Personal Banking (USPB). O segmento de Serviços inclui serviços de Tesouraria e Soluções Comerciais (TTS) e valores mobiliários. A TTS fornece um conjunto integrado de soluções personalizadas de gestão de caixa, comércio e capital de giro para corporações multinacionais, instituições financeiras e organizações do setor público. O segmento de Mercados oferece aos clientes corporativos, institucionais e do setor público em todo o mundo uma gama completa de serviços de vendas e negociação em ações, câmbio, taxas, spread de produtos e commodities. O segmento bancário inclui o investimento bancário, que apoia as necessidades de captação de capital do cliente para ajudar a fortalecer e expandir seus negócios. O segmento de riqueza inclui Private Bank, Wealth at Work e Citigold e fornece serviços financeiros para uma variedade de segmentos d', 'New York, NY, United States', 230000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANET', 'STOCK', 'Arista Networks Inc', 'NYQ', 'Technology', 'Computer Hardware', 'A Arista Networks, Inc. É fornecedora de redes cliente-nuvem orientadas por dados para ambientes de grande inteligência artificial (IA), data center, campus e roteamento. Suas plataformas oferecem disponibilidade, agilidade, automação, análise e segurança por meio de uma pilha operacional avançada de rede. Sua plataforma é o Sistema Operacional Extensível (EOS), um sistema operacional modernizado de rede de compartilhamento de estado de publicação-assinatura. Seu portfólio de produtos, serviços e tecnologias está agrupado em várias categorias: Núcleo (Data Center, Cloud e AI Networking), adjacências cognitivas (Campus e Roteamento) e Rede Cognitiva (Software e Serviços). Ele oferece portfólios de produtos de switches Ethernet de alta velocidade, nuvem e data center baseados em dados. Suas adjacências cognitivas incluem o Cognitive Campus Switching, o Cloud-Grade Routing e o WAN Routing. Seu software e serviços são baseados em modelos baseados em assinatura e incluem várias ofertas: Clo', 'Santa Clara, CA, United States', 4412);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BND', 'STOCK', 'Vanguard Total Bond Market Index Fund', 'NGM', NULL, NULL, 'This index measures the performance of a wide spectrum of public, investment-grade, taxable, fixed income securities in the United States-including government, corporate, and international dollar-denominated bonds, as well as mortgage-backed and asset-backed securities-all with maturities of more than 1 year. All of the fund''s investments will be selected through the sampling process, and at least 80% of its assets will be invested in bonds held in the index.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BE', 'STOCK', 'Bloom Energy Corporation', 'NYQ', 'Industrials', 'Electrical Equipment & Parts', 'Bloom Energy Corporation is engaged in stationary fuel cell power generation by market share. The Company provides distributed energy technology solutions to customers. The Company manufactures advanced and versatile fuel cell energy platforms, supporting the commercial availability of two products: the Bloom Energy Server for generating electricity and the Bloom Electrolyzer for producing hydrogen. With approximately 1.4 gigawatts (GW) of Energy Server systems deployed in more than 1,000 locations and nine countries. Its solid oxide fuel cell technology platform is the foundation for its Energy Server system and Bloom Electrolyzer. The Bloom Energy Server system is designed to deliver reliable, resilient, clean and affordable energy for utilities and organizations alike. Its Energy Server system is designed to deliver reliable electricity. The Bloom Electrolyzer is designed to provide hydrogen solutions based on the same solid oxide platform as its Energy Server systems.', 'San Jose, CA, United States', 2127);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIRE', 'STOCK', 'reAlpha Tech Corp.', 'NCM', 'Real Estate', 'Real Estate Services', 'reAlpha Tech Corp. is a real estate technology company developing an end-to-end commission-free home buying platform, namely, the reAlpha platform. The reAlpha platform integrates artificial intelligence (AI)-driven tools to offer tailored property recommendations, an intuitive visual interface, mortgage brokering, digital title and escrow services within the platform. The reAlpha platform assists homebuyers with tasks such as mortgage pre-approval, booking tours, sending offer letters and completing property acquisitions. The reAlpha platform also provides market insights, detailed property data, and uses large language models to answer queries and facilitate the homebuying process via a user-friendly, 24/7 Web platform and iOS application. It operates in the Technology services segment, which offers and develops AI-based products and services to customers in various industries, including, but not limited to, the real estate, retail, hospitality and education industries.', 'Dublin, OH, United States', 132);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMY', 'STOCK', 'Bristol-Myers Squibb Company', 'NYQ', 'Healthcare', 'Drug Manufacturers - General', 'A Bristol-Myers Squibb Company é uma empresa biofarmacêutica global. Está envolvida na descoberta, desenvolvimento e entrega de medicamentos transformacionais para pacientes que enfrentam doenças graves em áreas: oncologia, hematologia, imunologia, cardiovascular, neurociência e outras áreas. Suas plataformas incluem drogas quimicamente sintetizadas ou pequenas moléculas, incluindo degradadores de proteínas; medicamentos produzidos a partir de processos biológicos, chamados de biológicos; ADCs, terapias celulares CAR-T e terapêutica radiofármaco. As drogas pequenas da molécula são tipicamente administradas oralmente na forma de um tabuleta ou da cápsula, embora outros mecanismos da entrega da droga sejam usados igualmente. Os biológicos são normalmente administrados através de injeções ou por infusão intravenosa. As terapias celulares CAR-T são administradas por infusão intravenosa. Seu portfólio de crescimento inclui Opdivo, Opdivo Qvantig, Orencia, Yervoy, Reblozyl, Opdualag, e outro', 'Princeton, NJ, United States', 34100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AES', 'STOCK', 'The AES Corporation', 'NYQ', 'Utilities', 'Utilities - Diversified', 'A AES Corporation é uma empresa de energia. A empresa atua em quatro segmentos: Energias Renováveis, Utilidades, Infraestrutura Energética e Novas Tecnologias Energéticas. O segmento de energias renováveis inclui instalações solares, eólicas, de armazenamento de energia e de geração hídrica. O segmento de Utilities inclui as concessionárias regulamentadas AES Indiana, AES Ohio e AES El Salvador e suas instalações de geração. O segmento de Infraestrutura de Energia inclui gás natural, gás natural liquefeito (GNL), carvão, coque para animais de estimação, diesel e instalações de geração de petróleo, e seus negócios no Chile, que têm uma mistura de fontes de geração, incluindo energias renováveis. O segmento de Novas Tecnologias Energéticas inclui investimentos em Fluence, Utlight, Maximo e outras iniciativas. Possui duas linhas de negócio: Geração, que possui e/ou opera Usinas de energia para gerar e vender energia a clientes e Utilities que possuem e/ou operam utilidades para gerar ou c', 'Arlington, VA, United States', 9100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKKT', 'STOCK', 'Bakkt Holdings, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'Bakkt Holdings, Inc. builds technology that enables its clients to deliver new opportunities to their customers. Through Software as a Service (SaaS) and Application Programming Interface (API) solutions that provide crypto trading capabilities and loyalty solutions for its clients and customers. The Company operates primarily through the Bakkt Crypto Solutions, LLC (Bakkt Crypto), BakktX ECN, LLC (BakktX), and Bakkts Loyalty Solutions. Through the Bakkt Cryptos platform, customers can purchase approved crypto assets, store crypto assets in custodial wallets, liquidate their holdings, and transfer supported crypto assets between a custodial wallet maintained by Bakkt Crypto and external wallets in certain jurisdictions, if enabled by the client. BakktX order matching technology is being utilized by Bakkts in-house, retail-facing principal brokerage, Bakkt Crypto, to offer US clients and their customers.', 'Alpharetta, GA, United States', 559);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WINT', 'STOCK', 'Windtree Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Windtree Therapeutics, Inc. is a diversified company. The Company is engaged in the biotechnology business, advancing early and late-stage therapies for critical conditions and diseases. Its portfolio of product candidates includes istaroxime, a Phase II candidate with SERCA2a activating properties for acute heart failure and associated cardiogenic shock, preclinical SERCA2a activators for heart failure and preclinical precision aPKCi inhibitors that are being developed for potential in rare and broad oncology applications. Istaroxime is a first-in-class dual-mechanism therapy designed to improve both systolic and diastolic cardiac function. aPKCi inhibitor platform is a potential high-potency, specific, drug candidate with applications in oncology, particularly in hedgehog pathway-dependent cancers. The Company also has a licensing business model with partnership out-licenses in place. The Company is also focused on environmental services space.', 'Warrington, PA, United States', 14);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DJT', 'STOCK', 'Trump Media & Technology Group Corp.', 'NGM', 'Communication Services', 'Internet Content & Information', 'Trump Media & Technology Group Corp. (TMTG) is a social media and technology-focused company. The Company''s product, Truth Social, is a social media platform where any user can create content, follow other users and engage in an open global conversation. The Company does not restrict whom a user can follow. Additionally, users can be followed by other users without requiring a reciprocal relationship, enhancing the ability of its users to reach a broad audience. Its products and services include Truth Social and Truth+. TMTG operates a TV streaming platform, Truth+, across the entire Truth Social platform-iOS, Android, and the Web. The streaming service relies on TMTG''s custom-built content delivery network (CDN), which operates through a data center. TMTG''s streaming technology is powered through specially designed infrastructure with its own servers, routers, and software stack. The Company is also focused on launching Truth.Fi, a financial service and FinTech brand.', 'Sarasota, FL, United States', 29);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATNF', 'STOCK', '180 Life Sciences Corp.', 'NCM', 'Healthcare', 'Biotechnology', '180 Life Sciences Corp. is a biotechnology company, which focuses on the development of therapeutics for unmet medical needs in chronic pain, inflammation and fibrosis. Its programs include Anti-TNF (Clinical), Synthetic Cannabinoid Analogs (SCAs), and a7nAChR (Preclinical). The Company also operates a back-end technology platform to operate an online blockchain casino.', 'Palo Alto, CA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVTR', 'STOCK', 'Avantor, Inc.', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'Avantor, Inc. is a life science tools company and global provider of mission-critical products and services to the life sciences and advanced technology industries. The Companys segments include Laboratory Solutions and Bioscience Production. Within its segments, it sells materials and consumables, equipment and instrumentation and services and specialty procurement to customers in the biopharma and healthcare, education and government and advanced technologies and applied materials industries. Materials and consumables include ultra-high purity chemicals and reagents, lab products and supplies, highly specialized formulated silicone materials, customized excipients, and others. Equipment and instrumentation include filtration systems, virus inactivation systems, incubators, analytical instruments, and others. Services and specialty procurement include onsite lab and production, equipment, procurement and sourcing and biopharmaceutical material scale-up and development services.', 'Radnor, PA, United States', 13500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OPTT', 'STOCK', 'Ocean Power Technologies, Inc.', 'ASE', 'Industrials', 'Specialty Industrial Machinery', 'Ocean Power Technologies, Inc. provides ocean data collection and reporting, marine power, offshore communications and domain awareness services products, and integrated solutions. The Company focuses on three major service areas: Data as a Service (DaaS), which includes data collected by its Wave Adaptive Modular Vessel (WAM-V) autonomous vehicles or its PowerBuoy product lines; Robotics as a Service (RaaS), which provides a lower cost subscription model for its customers to access use of its WAM-Vs, and Power as a Service (PaaS), which includes its PowerBuoy and subsea battery products. The Company''s solutions are primarily suited to ocean and other offshore environments, and support generation of actionable intelligence on a standalone basis. The Company offers its products and services to a wide range of customers, including those in government and offshore energy, oil and gas, construction, science and research, wind power, and other industries.', 'Monroe Township, NJ, United States', 53);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASX', 'STOCK', 'ASE Technology Holding Co., Ltd.', 'NYQ', 'Technology', 'Semiconductors', 'ASE Technology Holding Co Ltd is a Taiwan-based company that mainly invests in packaging services, testing services, electronic product assembly technology and manufacturing services. The investment business includes general investment business projects. The packaging and testing business provides integrated circuit (IC) services, including packaging and module design, IC packaging, multi-chip packaging, micro and hybrid modules, memory packaging, front-end testing, wafer probe testing, finished product testing, substrate design, and manufacturing. The electronic manufacturing service business mainly provides a series of professional services such as development and design, material procurement, production and manufacturing, logistics, maintenance and other after-sales services for domestic and foreign brand manufacturers in the fields of communications, consumer electronics, computers, storage industrial, automotive electronics and other types of electronic products.', 'Kaohsiung, , Taiwan', 100450);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AI', 'STOCK', 'C3.ai, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'C3.ai, Inc. is an enterprise artificial intelligence (AI) application software company. The Company has built a solution that enables its customers to rapidly develop, deploy, and operate enterprise AI applications. It offers families of software solutions, which it collectively refers to as its C3 AI software: The C3 AI Platform, C3 AI Applications, and C3 Generative AI. The C3 AI Platform, its core technology, is a comprehensive, end-to-end application development and runtime environment that is designed to allow its customers to rapidly design, develop, and deploy Enterprise AI applications of any type. Its C3 AI Applications, built using the C3 AI Platform, is a portfolio of pre-built, extensible, industry-specific, and application-specific software-as-a-service offerings (SaaS) Enterprise AI applications that can be rapidly installed and deployed. Its C3 Generative AI combines the utility of large language models, generative AI, reinforcement learning, natural language processing.', 'Redwood City, CA, United States', 1181);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APH', 'STOCK', 'Amphenol Corporation', 'NYQ', 'Technology', 'Electronic Components', 'Amphenol Corporation é um designer, fabricante e comerciante de conetores elétricos, eletrônicos e de fibra ótica e sistemas de interconexão, antenas, sensores e produtos baseados em sensores e cabos especiais coaxiais e de alta velocidade. A Companhia atua através de três segmentos. O segmento de Soluções de Ambiente Harsh projeta, fabrica e comercializa uma gama de produtos de interconexão reforçada e outros produtos para uso na indústria, defesa, aeroespacial comercial, automotivo, redes móveis, etc. médicos e outros mercados. O segmento de Soluções de Comunicação projeta, fabrica e comercializa uma gama de sistemas de conetores e interconexão para uso nas tecnologias da informação e comunicações de dados, dispositivos móveis, industriais, redes móveis, comunicações de banda larga, mercado automotivo, aeroespacial comercial e de defesa final. Seu segmento de Sistemas de Interconexão e Sensor projeta, fabrica e comercializa uma gama de sensores, sistemas baseados em sensores, conetor', 'Wallingford, CT, United States', 125000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCCS', 'STOCK', 'CCC Intelligent Solutions Holdings Inc.', 'NMS', 'Technology', 'Software - Application', 'CCC Intelligent Solutions Holdings Inc. provides a software as a service (SaaS) platform for the property and casualty (P&C) insurance economy. The Company''s cloud-based SaaS platform connects trading partners, facilitates commerce, and supports artificial intelligence (AI) enabled digital workflows. Its solutions include CCC Insurance Solutions, CCC Repair Solutions, CCC Ecosystem and Other Solutions, and CCC International Solutions. Its CCC Insurance Solutions include CCC Workflow, CCC Estimating, CCC Total Loss, CCC Casualty, CCC Subrogation and CCC Automotive Claim Handling. Its repair solutions include CCC Estimating, CCC Network Management, CCC Repair Workflow and CCC Repair Quality. It offers enterprise solutions that support multiple customer segments, along with specific solutions tailored to other segments of the insurance ecosystem, including parts suppliers and automotive manufacturers. It provides insurance claims software to some of the automotive insurers in China.', 'Chicago, IL, United States', 2310);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SENS', 'STOCK', 'Senseonics Holdings, Inc.', 'ASE', 'Healthcare', 'Medical Devices', 'Senseonics Holdings, Inc. is a medical technology company focused on the development and manufacturing of glucose monitoring products designed to transform lives in the diabetes community. Its glucose monitoring (CGM) systems Eversense 365 and Eversense E3 include a small sensor inserted completely under the skin that communicates with a smart transmitter worn over the sensor. Its CGM systems are indicated for continually measuring glucose levels for up to 365 days for Eversense 365 and 180 days for Eversense E3 in persons with diabetes age 18 and older. Eversense consists of three primary components: a small sensor inserted subcutaneously under the skin by a healthcare provider; an external removable smart transmitter that receives, assesses and relays data from the sensor and provides vibratory alerts; and a mobile app that receives data from the transmitter and provides real-time glucose readings, alerts and other data the person''s mobile device.', 'Germantown, MD, United States', 117);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALAB', 'STOCK', 'Astera Labs, Inc.', 'NMS', 'Technology', 'Semiconductors', 'Astera Labs, Inc. is a global semiconductor company. The Company provides semiconductor-based connectivity solutions for cloud and artificial intelligence (AI) infrastructure. It has developed and deployed its Intelligent Connectivity Platform built from the ground up for cloud and AI infrastructure. Its Intelligent Connectivity Platform provides its customers with the ability to deploy and operate high-performance cloud and AI infrastructure at scale, addressing an increasingly diverse set of requirements. It provides its connectivity products in various form factors, including Integrated Circuits (ICs), boards, and modules. Its PCIe, CXL and Ethernet semiconductor-based connectivity solutions are purpose-built to unleash the potential of accelerated computing at cloud-scale. The Companys products include Aries products, which include its COSMOS software suite; Taurus products, which are hardware modules based on its Taurus ICs; Leo products; and Scorpio products.', 'Santa Clara, CA, United States', 440);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATAI', 'STOCK', 'Atai Life Sciences N.V.', 'NGM', 'Healthcare', 'Biotechnology', 'ATAI Life Sciences NV is a clinical-stage biopharmaceutical company. The Company focused on developing treatments for mental health disorders. The Company''s pipeline includes psychedelic and non-psychedelic compounds targeting depression, anxiety, and other unmet needs in psychiatry.', 'Berlin, , Germany', 54);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EQNR', 'STOCK', 'Equinor ASA', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'Equinor ASA, anteriormente Statoil ASA é uma empresa internacional de energia com sede na Noruega. O objetivo da Empresa é transformar os recursos naturais em energia. A Equinor vende petróleo bruto e entrega gás natural ao mercado europeu. Também está envolvida em atividades de processamento, refinação, captura e armazenamento de vento e carbono offshore. A Equinor ASA possui cinco segmentos de relatório: Exploração e Produção Noruega (E&P Noruega), Exploração e Produção Internacional (E&P International), Exploração e Produção EUA (E&P EUA), Marketing, Midstream & Processing (MMP) e Renováveis (REN). A Companhia possui diversas subsidiárias, como Equinor Nigeria Energy Company Ltd, Equinor Wind POWER AS, Equinor International Netherlands BV e Equinor Brasil Energia Ltda.', 'Stavanger, , Norway', 24126);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABCL', 'STOCK', 'AbCellera Biologics Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'AbCellera Biologics Inc. discovers and develops antibody medicines for indications across therapeutic areas, including cancer, metabolic and endocrine conditions, and autoimmune disorders. Its platform integrates technology, data science, infrastructure, and interdisciplinary teams to solve the challenging antibody discovery problems. It is focused on advancing an internal pipeline of programs and collaborating on drug development programs with partners. Its first two internal programs, ABCL635 and ABCL575, are in late-preclinical studies. ABCL635 is an antibody drug candidate for metabolic and endocrine conditions, and ABCL575 is an antibody drug candidate with broad potential in inflammatory conditions and autoimmune diseases and an initial indication in atopic dermatitis. ABCL575 binds OX40L to disrupt OX40/OX40L signaling, a regulator of inflammatory pathways in AD. In addition to ABCL635 and ABCL575, it is advancing a pipeline of more than 20 internal discovery programs.', 'Vancouver, BC, Canada', 596);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COMP', 'STOCK', 'Compass, Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'Compass, Inc. provides an end-to-end platform that empowers its residential real estate agents to deliver service to seller and buyer clients. Its platform includes an integrated suite of cloud-based software for customer relationship management, marketing, client service, brokerage services and other critical functionalities, all custom-built for the real estate industry. Its platform also uses proprietary data, analytics, artificial intelligence, and machine learning to simplify the workflows of agents and deliver recommendations and outcomes for both agents and their clients. It also provides integrated services, such as title and escrow and mortgage, both of which are available on its platform. Its Glide tools, which include completion of various real estate forms and offer preparation and eSignature and collaboration capabilities, are offered to non-Compass agents and their clients. Business Tracker provides agents with a centralized view of their entire business.', 'New York, NY, United States', 2566);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CELC', 'STOCK', 'Celcuity Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Celcuity Inc. is a clinical-stage biotechnology company, which develops targeted therapies for the treatment of multiple solid tumor indications. Its lead therapeutic candidate is gedatolisib, a potent, small-molecule reversible inhibitor that selectively targets all Class I isoforms of phosphatidylinositol-3-kinase (PI3K) and the two mechanistic targets of rapamycin (mTOR) sub-complexes, mTORC1 and mTORC2. Its development programs for gedatolisib focus on the treatment of patients with hormone receptor positive (HR+), human epidermal growth factor receptor 2 negative (HER2-), or HR+/HER2-, advanced or metastatic breast cancer and patients with metastatic castration resistant prostate cancer. A Phase III clinical trial of VIKTORIA-1, evaluating gedatolisib in combination with fulvestrant with or without palbociclib in patients with HR+/HER2- advanced breast has commenced. Its CELsignia companion diagnostic platform is able to analyze live patient tumor cells.', 'Minneapolis, MN, United States', 87);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENPH', 'STOCK', 'Enphase Energy, Inc.', 'NGM', 'Technology', 'Solar', 'A Enphase Energy, Inc. É uma empresa global de tecnologia energética. A empresa é um fornecedor de sistemas solares e de baterias baseados em microinversores que permitem às pessoas aproveitar o sol para fazer, usar, economizar e vender sua própria energia e controlar tudo com um aplicativo móvel inteligente. Projeta, desenvolve, fabrica e vende soluções de energia doméstica que gerenciam a geração de energia, o armazenamento de energia, o controle e as comunicações em uma única plataforma inteligente. O Enphase Energy System traz uma abordagem de tecnologia em rede para geração solar e armazenamento de energia, aproveitando sua experiência de design em eletrônica de energia, semicondutores e tecnologias de software baseadas em nuvem. O Sistema Energético Enphase, alimentado por MICROINVRATOES IQ, baterias IQ e outros produtos e serviços, é uma oferta integrada de gestão de energia solar, armazenamento e energia que permite o autoconsumo. A empresa também oferece uma plataforma de soft', 'Fremont, CA, United States', 2781);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYON', 'STOCK', 'Beyond, Inc.', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Beyond, Inc. is an e-commerce focused affinity company that owns or has ownership interests in various retail brands. The Company owns Bed Bath & Beyond, Overstock, Zulily, and other related brands and websites. Through its Bed Bath & Beyond brand, it provides an extensive array of home-related products. Its product categories include furniture, rugs, bedding, bath, kitchen, decor, outdoor, home improvement, lighting, baby and kids, and others. Through its Overstock brand, the Company provides an array of goods at discounted prices, and a treasure hunt-like experience for its target customers. Its product assortment includes core legacy categories such as indoor and outdoor furniture, apparel and footwear, rugs, decor, lighting, jewelry and watches, sports and entertainment, and others. Zulily''s primary focus is attracting a loyal customer base with flash sales on women''s, kid''s, and men''s apparel, footwear, beauty, and wellness. The Company also owns BuyBuy Baby brand.', 'Murray, UT, United States', 610);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARCC', 'STOCK', 'Ares Capital Corporation', 'NMS', 'Financial Services', 'Asset Management', 'Ares Capital Corporation is a specialty finance company focused on providing direct loans and other investments in private middle market companies in the United States. The Company invests primarily in first lien senior secured loans (including unitranche loans, which are loans that combine both senior and subordinated debt, generally in a first lien position), and second lien senior secured loans. In addition to senior secured loans, it also invests in subordinated debt, which in some cases includes an equity component, and preferred equity. It also may invest up to 30% of its portfolio in non-qualifying assets. Its investment activities are focused on industries, such as software and services, health care services, commercial and professional services, financial services, commercial and professional services, insurance Services, energy, food and beverage and others. Its investment adviser is Ares Capital Management LLC.', 'Los Angeles, CA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DKNG', 'STOCK', 'DraftKings Inc.', 'NMS', 'Consumer Cyclical', 'Gambling', 'A DraftKings Inc. É uma empresa de entretenimento e jogos de esportes digitais. Ele fornece aos usuários apostas esportivas on-line e de varejo (juntos, Sportsbook), cassino online (iGaming) e ofertas diárias de produtos esportivos de fantasia, bem como courier de loteria digital, mídia e outras ofertas de produtos. O Sportsbook é ao vivo com operações de apostas esportivas móveis e / ou varejo de acordo com os regulamentos em 28 estados, Washington, D.C., e em Ontário, Canadá. Opera iGaming de acordo com os regulamentos em cinco estados e em Ontário, Canadá sob sua marca DraftKings e de acordo com regulamentos em quatro estados sob sua marca Golden Nugget Online Gaming. Possui Jackpocket, um aplicativo de correio de loteria digital nos Estados Unidos. É um parceiro oficial de fantasia e apostas esportivas diário da NFL, NHL, PGA TOUR, WNBA e UFC, bem como um parceiro oficial de fantasia diário da NASCAR, um parceiro oficial de apostas esportivas da NBA. Ela também possui e opera o Dra', 'Boston, MA, United States', 5100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLDP', 'STOCK', 'Ballard Power Systems Inc.', 'NGM', 'Industrials', 'Specialty Industrial Machinery', 'Ballard Power Systems Inc. is engaged in the design, development, manufacture, sale and service of proton exchange membrane (PEM) fuel cell products for a variety of applications, focusing on power products for bus, truck, rail, marine, stationary and emerging market (material handling, off-road and other) applications, as well as the delivery of services, including technology solutions, after sales services and training. The Company operates through fuel cell products and services segment. Embedded in each Ballard fuel cell product lies a stack of unit cells designed with its PEM fuel cell technology that includes membrane electrode assemblies, catalysts, plates, and other key components, and draw on intellectual property from its patent portfolio, together with its experience and know-how, in key areas of PEM fuel cell stack design, operation, production processes and systems integration.', 'Burnaby, BC, Canada', 887);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXK', 'STOCK', 'Endeavour Silver Corp.', 'NYQ', 'Basic Materials', 'Silver', 'Endeavour Silver Corp. is a Canada-based mid-tier precious metals company. With operations in Mexico and Peru, and the development of its mine in Jalisco state, Terronera, the Company focuses on contributing to the mining industry and the communities in which it operates. In addition, it has a portfolio of exploration projects in Mexico, Chile and the United States. It has two producing silver-gold mines in Mexico: the Guanacevi Mine in Durango (the Guanacevi Project) and the Bolanitos Mine in Guanajuato (the Bolanitos Project). In addition to operating these two mines, the Company is advancing one development and two exploration projects in Mexico: the Terronera property in Jalisco state (the Terronera Project), the prospective Pitarrilla property in Durango State and the Parral properties in Chihuahua. Kolpa, its third producing mine, is a silver mine located in the Huachocolpa region of Huancavelica Province, Peru. Its other exploration projects include Bruner, Aida, and Lourdes.', 'Vancouver, BC, Canada', 1539);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('RDDT', 'STOCK', 'Reddit, Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'Reddit, Inc. operates a social platform, Reddit. Reddit is a community of communities. It is built on shared interests, passion, and trust and is home to open and authentic conversations on the Internet. Reddit is a global, digital city where anyone in the world can join a community to learn from one another, engage in authentic conversations, explore passions, research new hobbies, exchange goods and services, create new communities and experiences, share a few laughs, and find belonging. Reddit has thousands of communities, endless conversations, and authentic human connections. Communities on Reddit are organized based on specific interests and are called subreddits. Reddit offers real-time access to evolving and dynamic topics, such as sports, movies, news, fashion, and the latest trends. On Reddit, users can submit, vote, and comment on the topics they care about. It has approximately 100,000+ active communities and approximately 101+ million daily active visitors.', 'San Francisco, CA, United States', 2233);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASAN', 'STOCK', 'Asana, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Asana, Inc. is an enterprise work management software platform. It enables organizations to align work to goals, coordinate cross-functional work, gain visibility into progress, automate workflows across departments, and scale work securely. It offers two products within the Asana platform to meet the needs of diverse organizations. The Asana platform maintains an application programming interface that enables developers to build apps on Asana and integrate with hundreds of third-party applications like Microsoft Teams, Slack, Jira, Salesforce, Google Workspace, Adobe Creative Cloud and many more. Its flagship product, Asana Work Graph, provides a map of how all work gets done inside an organization. It is built for scale and captures the relationship between the work that teams undertake, the information about that work, the people doing the work, and the outcomes of that work. It provides interactive dynamic views list, calendar, board, timeline, goals, portfolio, reports and more.', 'San Francisco, CA, United States', 1819);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GT', 'STOCK', 'The Goodyear Tire & Rubber Company', 'NMS', 'Consumer Cyclical', 'Auto Parts', 'The Goodyear Tire & Rubber Company is a tire company. It develops, manufactures, distributes and sells tires for most applications. It also manufactures and sells rubber-related chemicals for various applications. It also operates commercial truck service and tire retreading centers. It operates approximately 800 retail outlets where it offers its products for sale to consumer and commercial customers and provides repair and other services. It manufactures its products in 53 manufacturing facilities in 20 countries. Its segments represent its regional tire businesses: the Americas, Europe, Middle East and Africa (EMEA), and Asia Pacific. It manufactures and sells numerous lines of rubber tires for automobiles, trucks, buses, aircraft, motorcycles, earthmoving and mining equipment, farm implements, industrial equipment, and various other applications. Its brands include Goodyear, Cooper, Kelly, Mastercraft, Roadmaster, Debica, Sava, Fulda, Mickey Thompson, Avon and Remington brands.', 'Akron, OH, United States', 68000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DPRO', 'STOCK', 'Draganfly Inc.', 'NCM', 'Industrials', 'Aerospace & Defense', 'Draganfly Inc. is a Canada-based company. The Company is a provider of drone solutions, Artificial intelligence (AI) driven software, and robotics. The Company provides solutions for public safety, agriculture, industrial inspections, security, mapping, and surveying. Its products include Apex, Commander 3XL, Heavy Lift Drone, Flex FPV, Commander 3XL Hybrid, Starling X.2, Payloads and Sensors, Draganflyer Commander2, Software, Precision Delivery System, Legacy Products and Projects, and Development Projects. Its services include custom engineering and drone services. Its engineering services include Hardware design, software design, development, modeling, ITAR equipment management, and support. Its drone services include aerial inspections, surveying and terrain mapping, emergency and disaster response, and landmine detection surveys. Its segments include Drones and Corporate. The Drones segment includes products and services related to the sale of unmanned aerial vehicles (UAV).', 'Saskatoon, SK, Canada', 51);\n